import React, { useState, useEffect } from 'react'
import axios from 'axios';

import { Box, 
Table,
Thead,
Tbody,
Tfoot,
Tr,
Th,
Td,
TableCaption,
TableContainer,
} from '@chakra-ui/react'







function UserData() {

    const [data, setData] = useState()


    const fetchData = async () => {
        try {
          const response = await axios.get ("http://localhost:3000/user");
          // const res = await response.json()
          setData(response.data);
          console.log(response)
        } catch (err) {
          console.log(err);
        }
      };

      useEffect (() => {
        fetchData();
      }, []);

  return (
    <Box margin={'10%'}>
        <Table variant>
            <Thead>
                <Tr>
                    <Th>NAME</Th>
                    <Th>EMAIL</Th>
                    <Th>PASSWORD</Th>
                </Tr>
            </Thead>
            {data?.length > 0 ? (
            data.map((item) => {
            return (
            <Tbody>
                <Tr>        
                    <Td>{item.name}</Td>
                    <Td>{item.email}</Td>
                    <Td>{item.password}</Td>
                </Tr>
            </Tbody>
                   )
                })
            ) : (
              <></>
            )}
        </Table>


    </Box>
  )
}

export default UserData
